import React, { Component } from "react";
import Typical from 'react-typical';
//▹
/*<Typical
  steps={[
    "have watched 200 anime",
    1500,
    "am watching 15 anime",
    1500,
    "am planning to watch 20 anime"
    ]}
  loop={Infinity}
  wrapper="b"

  <p className="mr1 neon">▹ </p>
    <p className="mr1"> I </p>
    <p className='dim'>

    </p>
/>*/

class Otaku extends Component {
  render() {
    return (
      <div>
        <div>
          <h4 className="tc">I am an avid watcher of anime... and I read a lot of manga as well. </h4>
        </div>

        <div className="flex flex-wrap justify-center name">
          <div>
            <h4 className="neon ph6">Anime</h4>
            <div>
              <p># of Anime Watched : 10</p>
              <p># of Anime Watching : 10</p>
              <p># of Anime to Watch : 10</p>
              <p># of Anime On Hold : 10</p>
              <p># of Anime Dropped : 10</p>
            </div>
          </div>
          <div>
            <h4 className="neon ph6">Manga</h4>
          </div>
        </div>
      </div>
    );
  }
}

export default Otaku;
